import React from 'react';
import { View } from 'react-native';

function Line() {
    return (
        <View style={{
            height: 2,
            backgroundColor: 'rgba(0, 0, 0 , 0.1)',
            alignSelf: 'stretch'
        }} />
    )
}

export default Line;
